function handleMessages(msg) {

    if (msg.payload.connected_device) {
        if (!connectedDevices.includes(msg.payload.connected_device)) {
            connectedDevices.push(msg.payload.connected_device); // Poprawka tutaj
        }
    } else if (msg.payload.disconnected_device) {
        const index = connectedDevices.indexOf(msg.payload.disconnected_device);
        if (index !== -1) {
            connectedDevices.splice(index, 1);
        }
    }

    context.set('connectedDevices', connectedDevices);

    const jsonData = connectedDevices.map(device => {
        return { "Connected device": device }; // Poprawka klucza tutaj
    });

    msg.payload = jsonData;
    return msg;
}

return handleMessages(msg);

